This Bible commentary on the the epistles of Paul was written by T.O.D. Johnston and published online by Owen Johnston. Galatians through Philemon is covered. The commentary is based on Bible study lessons on Romans that T.O.D. taught at Paran Baptist Church (located at 1603 Johnsonville Highway, Lake City, South Carolina). For more free lessons in PDF format, please visit our site.
